export const  increment = ()=>{
    return {
        type : 'INCREMENT'
    }
}

export const  incrementby5 = ()=>{
    return {
        type : 'INCREMENTBY5',
        payload: 5
    }
}

export const  decrement = ()=>{
    return {
        type : 'DECREMENT'
    }
}
